import React from 'react'
import { Header } from './Header';
import './Login.css';

function Login() {
    return (
        <div className='interfaz-login'><Header/>
            <div className='pantalla-login'>
                <a className='titulo-login'>Sistema de Login 1.0.1</a>
                <form className='formulario'>
                    <a className="text-user">Numero de identificacion</a>
                    <input className='input-user' type="text" placeholder="Ingresar ID"></input>
                    <a className="text-pass">Contraseña</a>
                    <input className='input-pass' type="text" placeholder="Ingresar Contraseña"></input>

                </form>
            </div>
        </div>

    )
}

export default Login;
